<style>
.js-chassis-animation {
  transform: translate(8%, -5%);
  transition: transform .35s ease-in-out .25s;
}

.js-chassis-animation.is-playing {
  transform: translate(0%, 0%);
}

.fade-out {
  filter: grayscale(100%);
}

.connection {
  opacity: 0;
}

.js-chassis-animation.is-playing .fade-out {
  animation: .25s linear .1s forwards turnon;
}

.js-chassis-animation.is-playing .connection {
  animation:
    .25s linear 0s infinite connect,
    .5s linear .1s forwards fadein;
}

@keyframes connect {
  from { stroke-dashoffset: 0; }
  to   { stroke-dashoffset: 4; }
}
@keyframes fadein {
  from { opacity: 0; }
  to   { opacity: 1; }
}

@keyframes turnon {
  from { filter: grayscale(100%); }
  to   { filter: grayscale(0%); }
}

</style>
